import React from 'react';
import Head from 'next/head';

const Meta = () => (
  <Head>
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <meta charSet="utf-8" />
    <link
      rel="preload"
      href="https://fonts.googleapis.com/css?family=Roboto:400,700&display=swap"
      as="font"
      crossOrigin=""
    />
    <title>R&M</title>
  </Head>
);

export default Meta;
